    true,nt"url": null,nt"notes": "Ready-to-Learn Television supports the development
    of educational television and digital media targeted at preschool and early elementary
    school children and their families.  This data-focused toolset site contains data
    visualizations and downloads. Ready-to-Learn TV's general goal is to promote early
    learning and school readiness, with a particular interest in reaching low-income
    children. In addition to creating television and other media products, the program
    supports activities intended to promote national distribution of the programming,
    effective educational uses of the programming, community-based outreach, and research
    on educational effectiveness. CFDA Number: 84.295",nt"license_title": "Creative
